import { Component } from '@angular/core';

@Component({
  selector: 'app-home-page',
  templateUrl: './home-page.component.html',
  styleUrls: ['./home-page.component.css']
})
export class HomePageComponent {
test() {
  console.log("merge");
}
}
<div class="container">
    <nav class="nav">
        <div class="nav_container">
            <h1>Skills Overflow</h1>
            <div class="nav_buttons">
                <button id="home" type="button" class="nav_button" (click)="test()" >Home</button>
                <button id="about" type="button" class="nav_button" (click)="test()" >About</button>
                <button id="faq" type="button" class="nav_button" (click)="test()" >FAQ</button>
                <button id="forum" type="button" class="nav_button" (click)="test()" >forum</button>
                <button id="members" type="button" class="nav_button" (click)="test()" >Members</button>
            </div>
            <div class="nav_profile">
                <i class="fa-regular fa-bell"></i>
                <p>user name</p>
                <i class="fa-sharp fa-solid fa-caret-down"></i>
            </div>
        </div>
    </nav>
</div>
